import styled from "styled-components";


interface IContainerProps {
    color: string;
}

interface ITagProps {
    color: string;

}

export const Container = styled.div<IContainerProps>`
    background-color: ${props => props.color};
`;

export const Tag = styled.div<ITagProps>`

`;
